import React, { useEffect, useState } from 'react';
import fetch_token from './fetch_token.js'; // 导入 fetch_token 函数
import fetch_calendar from './calendar.js'; // 导入 fetch_calendar 函数

function App() {
    const username = "1wadadwa5219";
    const [calendarData, setCalendarData] = useState([]);
    const [token, setToken] = useState(localStorage.getItem('access_token'));
    const [message, setMessage] = useState(localStorage.getItem('msg'));

    useEffect(() => {
        const fetchData = async () => {
            await fetch_token(username, "울산");
            setToken(localStorage.getItem('access_token'));
            setMessage(localStorage.getItem('msg'));
        };
        fetchData();
    }, [username]);

    useEffect(() => {
        const fetchData = async () => {
            if (token) {
                try {
                    const data = await fetch_calendar(token); // 获取日历数据
                    setCalendarData(data); // 更新状态
                } catch (error) {
                    console.error("Error fetching calendar data:", error);
                }
            }
        };
        fetchData();
    }, [token]);

    return (
        <div>
            <h3>Information</h3>
            <p>Token: {token || "No token available"}</p>
            <p>Message: {message || "No message available"}</p>

            <h3>Past Events</h3>
            <ul>
                {calendarData.map(event => (
                    <li key={event.id}> {/* 假设每个事件都有一个唯一的 id */}
                        {event.title} - {event.date} {/* 假设事件有 title 和 date 字段 */}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default App;
